import Layout from "../components/Layout";
import Project from '../components/Project';
function Work() {
  return (
    <Layout>
      <h1>Check out my work</h1>
      <div className="projects">
        <div className="project-list">
          <Project>
            <h2>Flight App</h2>
          </Project>


          <Project>
            <h2>Bible App</h2>
          </Project>


          <Project>
            <h2>Chat App</h2>
          </Project>

          <Project>
            <h2>Weather App</h2>
          </Project>
        </div>
      </div>
      <style jsx>{`
        .projects {
          max-width: 1000px;
          margin: 0 auto;
        }

        .project-list {
          padding: 0 30px;
          display: flex;
          flex-wrap: wrap;
          justify-content: space-between;
        }
      `}</style>
    </Layout>
  );
}

export default Work;
